Il y a deux types de candidats à la présidentielle :
– ceux qui sont sur le terrain, et ont réussi à obtenir leurs parrainages, comme @n_arthaud ;
– ceux qui pensent qu'il suffit de passer à la télé pour avoir ses parrainages, comme @MLP_officiel, @JLMelenchon ou @ZemmourEric.

@2022Elections @n_arthaud @LutteOuvriere Dans mon département, un maire avait donné sa promesse de parrainage à Artaud pensant qu'une petite candidate devait avoir du mal à les obtenir
Quand il a su qu'elle en avait 800 et Mélenchon 400 il a contacté le représentant LO du secteur
Refus catégorique de ce dernier 🤬🤬🤬

Une chose ne peut que sauter aux yeux de tout le monde.
@JLMelenchon est un homme honnête, cohérent, constant et humaniste. 
Tous les autres, à part @PhilippePoutou et @n_arthaud , s'enfonce progressivement dans la logique de haine et de peur ou dans les petits calculs minables.

